import React from "react";

const Projects = () => {
    return (
        <div className="App-projects">
            <h1 className="section-title">Projects</h1>
            <div className="container">
                <div className="preview"></div>
                <h1 className="preview-title"></h1>
            </div>

        </div>
    );
};

export default Projects;
